import LogoHeaderIcon from '../../ui/LogoHeaderIcon.js'
import LogoFooterIcon from '../../ui/LogoFooterIcon.js'

const Logo = ({className, position}) => {

  console.log(position);

  return (
    position === 'header' 
    ? (
      <button
        data-btn="root"
        className="${parentClassName}__logo"
      >
        ${LogoHeaderIcon()}
      </button>
    )
    : 
    <button
        data-btn="root"
        class="${parentClassName}__logo"
      >
        ${LogoFooterIcon()}
      </button>  
  )  
}

export default Logo
